import styled from "styled-components";

export const Container = styled.div`
width: 500px;
height: 500px;
background-color: red;
border-radius: 5px;
box-shadow: 1px black;
`

export const LogoContainer = styled.div`
  width: 45px;
  height: 45px;

  img {
    width: 100%;
  }
`;
